import React, {useEffect, useState} from "react";
import { Link } from "react-router-dom";
import axios from "axios";

function ProductList(){

    const [productData, setProductData] = useState([]);
    useEffect( ()=>{
        const getProductList = async()=>{
            /*const reqProduct = await fetch("http://localhost:8080/produtos",{mode: 'cors'});
            const resProduct = await reqProduct.json();
            setProductData(resProduct);
            console.log(resProduct);*/
            var res = await axios.get("http://localhost:8080/produtos");
            if (res?.data) {
                setProductData(res.data);
            }
            console.log(productData.current);
        }
        getProductList();

    },[]);
    return(
        <React.Fragment>
            <div className="container">
                <h5>Lista de Produtos</h5>
                <table className="table">
                    <thead>
                        <tr>
                            <th scope="col">#</th>
                            <th scope="col">Nome</th>
                            <th scope="col">Valor</th>
                            <th scope="col">Ação</th>
                        </tr>
                    </thead>
                    <tbody>
                        {
                            productData && productData.map && productData.map((pData, index)=>(
                                <tr key={index}>
                                    <th>{index+1}</th>
                                    <td>{pData.nome}</td>
                                    <td>{pData.valor}</td>
                                    <td>
                                        <Link to={"/editproduct/"+pData.id} className="btn btn-success">Editar</Link>
                                        <Link to={"/deleteproduct/"+pData.id} className="btn btn-danger">Deletar</Link>
                                    </td>
                                </tr>
                            ))
                        }

                    </tbody>
                </table>

            </div>
        </React.Fragment>
    );
}

export default ProductList;
